import React from 'react';
import { Link } from 'react-router-dom';

export default function FAQPage() {
  const faqItems = [
    {
      id: 'change-booking',
      question: 'How do I change my booking?',
      short: 'Steps to modify your trip info and travelers.'
    },
    {
      id: 'request-refund',
      question: 'How do I request a refund?',
      short: 'Refund policies and process explained.'
    },
    {
      id: 'flight-status',
      question: 'How do I check my flight status?',
      short: 'Track your flight status in real-time.'
    },
    {
      id: 'account-access',
      question: 'I can’t access my account. What should I do?',
      short: 'Reset password and troubleshoot login issues.'
    },
    {
      id: 'baggage-policy',
      question: 'What is the baggage policy?',
      short: 'Know what you can bring and baggage limits.'
    }
  ];

  return (
    <main className="max-w-4xl mx-auto p-6 text-gray-800">
      <h1 className="text-3xl font-bold mb-6 text-center">Help Center FAQs</h1>
      <ul className="space-y-4">
        {faqItems.map((item) => (
          <li key={item.id} className="bg-white p-4 rounded-lg shadow-md">
            <Link to={`/faq/${item.id}`}>
              <h3 className="text-xl font-semibold text-pink-600 hover:underline">{item.question}</h3>
              <p className="text-gray-500 mt-2">{item.short}</p>
            </Link>
          </li>
        ))}
      </ul>
    </main>
  );
}
